import React from "react";
import { useState } from "react";
import axios from "axios";
import { useEffect } from "react";
import {  BrowserRouter ,Link,Router,  Routes,  Route} from "react-router-dom";
import Candels from './Candels'
const FetchName = () =>
    {
    var x=1
    var y=[]
    const [name,Setname]=useState()
    const [lo,setlogo]=useState()
    const [exc,setexchange]=useState()
    const [url,seturl]=useState()
    const [phn,setphone]=useState()
    const [insdustry,setindusrty]=useState() 
    const [cp,currentp]=useState()

    var f=''
    var syn='ggg'
    function fetch(e)
    {
         f=e.target.value
         return(<>
         <BrowserRouter>
     
      <Routes>
          <Route path="contact" element={<Candels name={f} />} />
      </Routes>
    </BrowserRouter></>)
         
    }
    function FetchSearch()
    {
        axios
                .get(`https://finnhub.io/api/v1/stock/profile2?symbol=${f}&token=cjmeg19r01qmdd9puljgcjmeg19r01qmdd9pulk0`)
        .then((response) =>
        {
               const {name,logo,weburl,exchange,phone,finnhubIndustry}= response.data
                 Setname(name)
                 setlogo(logo)
                 setexchange(exchange)
                 setindusrty(finnhubIndustry)
                 setphone(phone)
                 seturl(weburl)
            
        })
        axios
        .get(`https://finnhub.io/api/v1/quote?symbol=${f}&token=cjmeg19r01qmdd9puljgcjmeg19r01qmdd9pulk0`)
.then((response) =>
{
       const {c}= response.data
             currentp("price: $ "+ c)
    
})

    
}

    return(<>
    
    <input type="text" onChange={fetch}/>
    <button onClick={FetchSearch}>Generate</button>
     <h1>{name}</h1>
     <img src={lo}/>
     <h2>{cp}</h2>
     <h2>{exc}</h2>
     <h2>{insdustry}</h2>
     <h2>{phn}</h2>
     <Link to="/contact">{name}</Link>
    
    
    </>)
}
  

export default FetchName
